rce allows you to accept credit cards, debit cards, netbanking, wallet, and UPI payments.'=>'Званично проширење Razorpay за WooCommerce омогућава вам прихватање кредитних картица, дебитних картица, мрежног банкарства, новчаника и УПИ плаћања.','Razorpay'=>'Razorpay','How easy was it to update your settings?'=>'Колико је било лако ажурирати подешавања?','How easy was it to update an order?'=>'Колико је било лако ажурирање поруџбине?','You have attempted to register a duplicate item with WooCommerce Navigation: %1$s'=>'Покушали сте да региструјете дупликат ставке помоћу WooCommerce навигације: %1$s','Thank you for your feedback!'=>'Хвала на повратним информацијама!','Coupon usage limit has been reached. Please try again after some time, or contact us for help.'=>'Досегнуто је ограничење употребе купона. Покушајте поново након неког времена или нас контактирајте за помоћ.','Current set billing address for the customer.'=>'Тренутно постављена адреса за обрачун за купца.','The discount type for the coupon (e.g. percentage or fixed amount)'=>'Врста попуста за купон (нпр. проценат или фиксни износ)','The coupon\'s unique code.'=>'Јединствени код купона.','An account is already registered with your email address. Please log in before proceeding.'=>'Налог је већ регистрован са вашом адресом е-поште. Молимо вас да се пријавите пре него што наставите.','Unable to create order'=>'Није могуће направити наруџбину','The date the last order for this product was placed, in the site\'s timezone.'=>'Датум последње поруџбине за овај производ у временској зони веб локације.','Alias for customer_type (deprecated).'=>'Псеудоним за тип корисника (застарело).','Coupon usage limit has been reached. If you were using this coupon just now but your order was not complete, you can retry or cancel the order by going to the <a href="%s">my account page</a>.'=>'Достигнут је лимит коришћења купона. Ако сте управо користили овај купон, али ваша наруџбина није била завршена, можете покушати поново или