en applied).'=>'Редни међузбир (цена производа пре примењивања купонских попуста).','Line subtotal tax.'=>'Редни порез међузбира.','Line total (the price of the product after coupon discounts have been applied).'=>'Редни тотал (цена производа након што су купонски попусти примењени).','Line total tax.'=>'Редни порез тотала.','Word count type. Do not translate!words'=>'речи','Order statusDraft'=>'Нацрт','True if backorders are allowed past stock availability.'=>'Тачно ако су дозвољене наруџбине на захтев по нестанку залиха.','1 minute per product'=>'1 минут по производу','1 minute'=>'1 минут','2 minutes'=>'2 минута','4 minutes'=>'4 минута','Store details'=>'Детаљи о продавници','Undo'=>'Опозови','The maximum quantity that can be added to the cart is %s'=>'Максималана количина овог артикла у корпи је %s','The ID of the payment method being used to process the payment.'=>'ИД начина плаћања који се користи за обраду плаћања.','Result of payment processing, or false if not yet processed.'=>'Резултат обраде плаћања или „није тачно“ ако још није обрађен.','An array of data being returned from the payment gateway.'=>'Низ података који се враћају од процесора плаћања.','A URL to redirect the customer after checkout. This could be, for example, a link to the payment processors website.'=>'УРЛ за преусмеравање купца након куповине. То би могла бити, на пример, веза до веб локације процесора плаћања.','The coupons unique code.'=>'Јединствени код купона.','Total amounts provided using the smallest unit of the currency.'=>'Укупнe количине предмета обезбеђене помоћу најмање јединице валуте.','Total discount applied by this coupon.'=>'Укупан попуст који се добија овим купоном.','Total tax removed due to discount applied by this coupon.'=>'Умањени порез због попуста који је добијен овим купоном.','Currency code (in ISO format) for returned prices.'=>'Валутни код (у ИСО формату) за враћене цене.','Currency symbol for the currency which can be used to format returned prices.'=>'Валу