ним производима и без трошкова испоруке.','Total price of items in the cart.'=>'Укупна цена предмета у корпи.','Total price of any applied fees.'=>'Укупна вредност свих примењених накнада.','Total tax on fees.'=>'Укупни порез на провизије.','Total discount from applied coupons.'=>'Укупан попуст на примењене купоне.','Total tax removed due to discount from applied coupons.'=>'Укупан умањен порез због попуста на примењене купоне.','Total price of shipping.'=>'Укупна цена слања.','Total price the customer will pay.'=>'Укупна цена коју ће купац платити.','Total tax applied to items and shipping.'=>'Укупан порез примењен на артикле и слање.','Lines of taxes applied to items and shipping.'=>'Ставке пореза које се примењују на артикле и слање.','The name of the tax.'=>'Назив пореза.','The amount of tax charged.'=>'Износ обрачунатог пореза.','List of cart item errors, for example, items in the cart which are out of stock.'=>'Листа грешака у ставкама корпе, на пример, ставке у корпи којих нема на залихама.','The ID of the package the shipping rates belong to.'=>'ИД пакета коме припадају цене испоруке.','Name of the package.'=>'Назив пакета.','Shipping destination address.'=>'Одредишна адреса испоруке.','List of cart items the returned shipping rates apply to.'=>'Листа артикала у корпи на које се односе цене враћања пакета.','Name of the item.'=>'Назив артикла.','Quantity of the item in the current package.'=>'Количина артикла у тренутном паковању.','ID of the shipping rate.'=>'ИД тарифе слања.','Name of the shipping rate, e.g. Express shipping.'=>'Назив тарифе слања, нпр. експресно слање.','Description of the shipping rate, e.g. Dispatched via USPS.'=>'Опис тарифе слања, нпр. слање путем USPS-а.','Delivery time estimate text, e.g. 3-5 business days.'=>'Текст за процену времена испоруке, нпр. 3-5 радних дана.','Price of this shipping rate using the smallest unit of the currency.'=>'Цена ове тарифе слања користећи најмању јединицу валуте.','ID of the shipping method that provided the rate.'=>'ИД начина слања који је пружио цену.','Error message'=>'Порука о грешци','Current set shipping address for the customer.'=>'Тренутно постављена адреса испоруке за купца.','Cart total amounts provided using the smallest unit of the currency.'=>'Укупни износи у корпи дати са најмањом јединицом валуте.','Total tax on items in the cart.'=>'Укупан порез на ставке у корпи.','List of shipping rates.'=>'Листа тарифа слања.','Status of the payment returned by the gateway. One of success, pending, failure, error.'=>'Статус плаћања који је процесор плаћања вратио. Један од: успешно, на чекању, неуспешно, грешка.','Zip or Postcode of the address being shipped to.'=>'ПАК или Поштански број адресе на коју се шаље.','"%s" has already been applied and cannot be used in conjunction with other coupons.'=>'„%s“ је већ примењен и не може се користити заједно са другим купонима.','Second line of the address being shipped to.'=>'Друга линија адресе на коју се шаље.','City of the address being shipped to.'=>'Град адресе у који се шаље.','Unique identifier for the coupon within the cart.'=>'Јединствени идентификатор за купон унутар корпе.','Coupons are disabled.'=>'Купони су онемогућени.','Invalid coupon code.'=>'Неважећи код купона.','Coupon cannot be removed because it is not already applied to the cart.'=>'Купон се не може уклонити јер није већ примењен на корпу.','Coupon does not exist in the cart.'=>'Купон не постоји у корпи.','Sort ascending or descending.'=>'Поређај узлазно или силазно.','If true, empty terms will not be returned.'=>'Ако је „тачно“, празни услови се неће вратити.','Sort by term property.'=>'Поређај по својствима услова.','Unique identifier (key) for the cart item.'=>'Јединствени идентификатор (кључ) за корпу.','Cart item no longer exists or is invalid.'=>'Артикал корпе више не постоји или је неважећи.','Data to pass through to the payment method when processing payment.'=>'Подаци који се прослеђују начину плаћања приликом обраде плаћања.','Invalid payment result received from payment method.'=>'Неважећи резултат плаћања примљен од начина плаћања.','No payment method provided.'=>'Није наведен начин плаћања.','Unique identifier (key) for the cart item to update.'=>'Јединствени идентификатор (кључ) за ажурирање ставке у корпи.','New quantity of the item in the cart.'=>'Нова количина предмета у корпи.','Cannot create order from empty cart.'=>'Није могуће направити поруџбину из празне корпе.','Cart item is invalid.'=>'Артикал је неважећи.','Method not implemented'=>'Метода није примењена','Invalid coupons were removed from the cart: "%s"'=>'Неважећи купони су уклоњени из корпе: „%s“','"%s" is an invalid coupon code.'=>'„%s“ је неважећи код купона.','The "%1$s" coupon has been removed from your cart: %2$s'=>'Купон „%1$s“ је уклоњен из ваше корпе: %2$s','&quot;%s&quot; is not available for purchase.'=>'&quot;%s&quot; није доступан за куповину.','ISO code for the country of the address being shipped to.'=>'ИСО код државе за адресу у коју се шаље.','Limit result set to products based on a minimum price, provided using the smallest unit of the currency.'=>'Постављен је лимит за производе засноване на минималној цени, под условом да се користи најмања јединица валуте.','Limit result set to products based on a maximum price, provided using the smallest unit of the currency.'=>'Постављен је лимит за производе засноване на максималној цени, под условом да се користи најмања јединица валуте.','First line of the address being shipped to.'=>'Први ред адресе на коју се шаље.','List of variation IDs, if applicable.'=>'Листа ИД-а варијацијa, ако је применљиво.','Order status. Payment providers will update this value after payment.'=>'Статус поруџбине. Провајдери плаћања ће ажурирати ову вредност након плаћања.','Quantity left in stock if stock is low, or null if not applicable.'=>'Количина на лагеру ако су залихе ниске, или нула ако није применљиво.','Note added to the order by the customer during checkout.'=>'Напомена коју је купац додао у наруџбину током плаћања.','Customer ID if registered. Will return 0 for guests.'=>'ИД клијента ако је регистрован. Вратиће 0 за госте.','Coupon code "%s" has already been applied.'=>'Код купона „%s“ је већ примењен.','Product full description in HTML format.'=>'Пун опис производа у HTML формату.','Product short description in HTML format.'=>'Кратак опис производа у HTML формату.','Order key used to check validity or protect access to certain order data.'=>'Кључ наруџбине који се користи за проверу валидности или заштиту приступа одређеним подацима наруџбине.','The order ID to process during checkout.'=>'ID наруџбине за обраду током плаћања.','Parent term ID, if applicable.'=>'ИД родитеља, ако је применљиво.','Price string formatted as HTML.'=>'Низ цена форматиран као ХТМЛ.','Price data provided using the smallest unit of the currency.'=>'Подаци о ценама добијени са најмањом јединицом валуте.','ID of the parent product, if applicable.'=>'ID матичног производа, ако је применљиво.','The chosen rate ID for the package.'=>'Изабрани ID цене за пакет.','Limit result set to reviews from specific product IDs.'=>'Ограничити скуп резултата на рецензије одређених ID-ова производа.','Limit result set to reviews from specific category IDs.'=>'Ограничити резултат постављен на рецензије из одређених ID-ова категорија.','ISO code, or name, for the state, province, or district of the address being shipped to.'=>'ISO код или назив за државу, покрајину или округ адресе у коју се шаље.','The %s payment gateway is not available.'=>'Овај %s процесор плаћања није доступан.','You need WooCommerce 4.2 or newer to run this tool.'=>'За покретање овог алата вам је потребан WooCommerce 4.2 или новији.','Database verified successfully.'=>'База података је успешно верификована.','Verifying database... One or more tables are still missing: '=>'Провера базе података ... Још увек недостаје једна или више табела:','The active version of WooCommerce does not support template cache clearing.'=>'Активна верзија WooCommerce-а не подржава брисање предмеморије предлошка.','Template cache cleared.'=>'Кеш предлошка је очишћен.','Verify database'=>'Верификујте базу података','If your store is based in the EU, we recommend using the EU VAT Number extension in addition to automated taxes. It provides your checkout with a field to collect and validate a customer\'s EU VAT number, if they have one.'=>'Ако је ваша продавница са седиштем у ЕУ, препоручујемо вам да уз аутоматске порезе користите и проширење ЕУ ПДВ броја. Омогућује у процесу плаћања поље за прикупљање и потврђивање ЕУ ПДВ броја купца, ако га поседују.','Collect and validate EU VAT numbers at checkout'=>'Прикупите и потврдите ЕУ ПДВ бројеве приликом плаћања','Get real-time order alerts anywhere'=>'Добијајте обавештења о наруџбинама у реалном времену било где','Get notifications about store activity, including new orders and product reviews directly on your mobile devices with the Woo app.'=>'Примајте обавештења о активностима у продавници, укључујући нове поруџбине и прегледе производа директно на мобилне уређаје помоћу апликације Woo.','Remove legacy coupon menu'=>'Уклоните стари мени купона','Coupons can now be managed from Marketing > Coupons. Click the button below to remove the legacy WooCommerce > Coupons menu item.'=>'Купонима се сада може управљати из Маркетинг > Купони. Кликните на доње дугме да бисте уклонили стару ставку менија WooCommerce > Купони.','Invalid category ID.'=>'Неважећи ИД категорије.','Verify base database tables'=>'Верификуј основне табеле базе података','Clear template cache'=>'Избриши предмеморију шаблона','This tool will empty the template cache.'=>'Овај алат ће испразнити кеш шаблона.','Verify if all base database tables are present.'=>'Провери да ли су све табеле базе података присутне.','First order received'=>'Прва наруџбина је примљена','Maximum number of items to be returned in result set. Defaults to no limit if left blank.'=>'Максималан број ставки које треба вратити у скуп резултата. Подразумевано нема ограничења ако се остави празно.','WooCommerce %1$s table creation failed. Does the %2$s user have CREATE privileges on the %3$s database?'=>'Није успело стварање WooCommerce %1$s табеле. Да ли корисник %2$s има CREATE привилегије у %3$s бази података?','Start your online clothing store'=>'Отворите своју интернет продавницу одеће','Starting a fashion website is exciting but it may seem overwhelming as well. In this article, we\'ll walk you through the setup process, teach you to create successful product listings, and show you how to market to your ideal audience.'=>'Покретање веб странице о моди је узбудљиво, али може изгледати и неодољиво. У овом чланку ћемо вас провести кроз поступак подешавања, научити вас да креирате успешне листе производа и показати вам како да продајете својој идеалној публици.','Do you need help with adding your first product?'=>'Да ли вам треба помоћ око додавања вашег првог производа?','Coupon management has moved!'=>'Управљање купонима је премештено!','This video tutorial will help you go through the process of adding your first product in WooCommerce.'=>'Овај видео водич ће вам помоћи да прођете кроз поступак додавања свог првог производа у WooCommerce-у.','The admin note layout has a wrong prop value.'=>'Изглед административне белешке има погрешну вредност.','Watch tutorial'=>'Погледајте туториал','Now that you’ve chosen us as a partner, our goal is to make sure we\'re providing the right tools to meet your needs. We\'re looking forward to having your feedback on the store setup experience so we can improve it in the future.'=>'Сада када сте нас одабрали за партнера, наш циљ је да осигурамо да пружимо праве алате за испуњавање ваших потреба. Радујемо се што ћемо добити ваше повратне информације о искуству подешавања продавнице како бисмо је побољшали у будућности.','Share feedback'=>'Поделите поврате информације','Changing eCommerce platforms might seem like a big hurdle to overcome, but it is easier than you might think to move your products, customers, and orders to WooCommerce. This article will help you with going through this process.'=>'Промена платформе за е-трговину може се чинити као велика препрека за превладавање, али лакше је него што можда мислите да своје производе, купце и поруџбине преместите у WooCommerce. Овај чланак ће вам помоћи да прођете кроз овај процес.','Do you want to migrate from Shopify to WooCommerce?'=>'Да ли желите да пређете из Shopify у WooCommerce?','WooCommerce Subscriptions allows you to introduce a variety of subscriptions for physical or virtual products and services. Create product-of-the-month clubs, weekly service subscriptions or even yearly software billing packages. Add sign-up fees, offer free trials, or set expiration periods.'=>'Претплате на WooCommerce омогућавају вам да уведете различите претплате за физичке или виртуелне производе и услуге. Креирајте клубове са производима за месец, претплате на недељне услуге или чак годишње пакете за наплату софтвера. Додајте накнаде за регистрацију, нудите бесплатни пробни период или одредите временске рокове важења.','Visitors'=>'Посетилаца','Views'=>'Прегледа','Kajiado'=>'Кајиадо','Kakamega'=>'Какамега','Kericho'=>'Керичо','Kiambu'=>'Киамбу','Kilifi'=>'Килифи','Kirinyaga'=>'Кириниага','Kisii'=>'Киси','Kisumu'=>'Кисуму','Kitui'=>'Китуи','Kwale'=>'Квале','Laikipia'=>'Лаикипиа','Lamu'=>'Ламу','Machakos'=>'Мачакос','Makueni'=>'Макуени','Mandera'=>'Мандера','Marsabit'=>'Марсабит','Meru'=>'Меру','Migori'=>'Мигори','Mombasa'=>'Момбаса','Murang’a'=>'Муранга','Nairobi County'=>'Најроби провинција','Nakuru'=>'Накуру','Nandi'=>'Нанди','Nyamira'=>'Њамира','Narok'=>'Нарок','Nyandarua'=>'Њандаруа','Nyeri'=>'Њери','Siaya'=>'Сиаја','Samburu'=>'Самбуру','Tana River'=>'Река Тана','Taita-Taveta'=>'Таита-Тавета','Tharaka-Nithi'=>'Тарака-Нити','Trans Nzoia'=>'Транс Нзоиа','Turkana'=>'Туркана','West Pokot'=>'Западни Покот','Wajir'=>'Ваџир','Vihiga'=>'Вихига','Uasin Gishu'=>'Уасин Гишу','Bomet'=>'Бомет','Baringo'=>'Баринго','Garissa'=>'Гариса','Embu'=>'Ембу','Elgeyo-Marakwet'=>'Елгејо-Мараквет','Bungoma'=>'Бунгома','Isiolo'=>'Исиоло','Homa Bay'=>'Залив Хома','One or more tables required for WooCommerce to function are missing, some features may not work as expected. Missing tables: %1$s.'=>'Једна или више табела потребних за функционирање WooCommerce-а недостају, неке функције можда неће радити како се очекује. Недостају таблице: %1$s.','The layout of the note (e.g. banner, thumbnail, plain).'=>'Изглед белешке (нпр. банер, сличица, обичан).','The requested plugin `%s`. is not yet installed.'=>'Тражени додатак „%s“ још није инсталиран.','There was a problem installing some of the requested plugins.'=>'Дошло је до проблема приликом инсталирања неких тражених додатака.','Plugins were successfully installed.'=>'Додаци су успешно инсталирани.','&quot;%s&quot; is out of stock and cannot be purchased.'=>'&quot;%s&quot; нема на залихама и не може се купити.','Do you need more info about WooCommerce Subscriptions?'=>'Да ли вам треба више информација о претплатама на WooCommerce?','There was a problem activating some of the requested plugins.'=>'Дошло је до проблема при активирању неких тражених додатака.','Plugins were successfully activated.'=>'Додаци су успешно активирани.','Not enough units of %s are available in stock to fulfil this order.'=>'На залихама нема довољно комада %s да би се испунила ова наруџбина.','Registers whether the note is deleted or not'=>'Региструје да ли је напомена избрисана или не','The image of the note, if any.'=>'Слика белешке, ако постоји.','Sorry, there is no note with that ID.'=>'Жао нам је, нема напомене са тим ID-ом.','Plugins must be a non-empty array.'=>'Додаци не могу бити празан низ.','Start using new features that are being progressively rolled out to improve the store management experience.'=>'Почните да користите нове функције које се поступно уводе да бисте побољшали искуство управљања продавницом.','Features'=>'Функционалности','The requested plugin `%s` could not be installed. Upgrader install failed.'=>'Захтевани додатак `%s` не може бити постављен. Инсталација није успела.','One or more tables required for WooCommerce to function are missing, some features may not work as expected. Missing tables: %1$s. <a href="%2$s">Check again.</a>'=>'Једна или више табела потребних за функционирање WooCommerce-а недостају, неке функције можда неће радити како се очекује. Недостају табеле: %1$s. <a href="%2$s">Проверите поново.</a>','Database tables missing'=>'Недостају табеле базе података','Missing base tables: %s. Some WooCommerce functionality may not work as expected.'=>'Недостају основне табеле: %s. Неке WooCommerce функције можда неће радити како се очекивало.','Overview'=>'Преглед','Home'=>'Почетна','Take payments with the provider that’s right for you - choose from 100+ payment gateways for WooCommerce.'=>'Узмите уплате код добављача који одговара вама - одаберите између 100 и више посредника у плаћању за WooCommerce.','Import / Export'=>'Увоз / Извоз','Utilities'=>'Алати','Marketplace'=>'Маркет','Start accepting payments on your store!'=>'Почните да прихватате плаћања у својој продавници!','Install plugins'=>'Инсталирајте додатке','Uh oh... There was a problem during the Jetpack and WooCommerce Shipping & Tax install. Please try again.'=>'Ух ох ... Дошло је до проблема током инсталације Jetpack и WooCommerce сервиса. Молим вас, покушајте поново.','We noticed that there was a problem during the Jetpack and WooCommerce Shipping & Tax install. Please try again and enjoy all the advantages of having the plugins connected to your store! Sorry for the inconvenience. The "Jetpack" and "WooCommerce Shipping & Tax" plugins will be installed & activated for free.'=>'Приметили смо да је дошло до проблема током инсталације Џетпака и Вукомерц сервиса. Покушајте поново и уживајте у свим предностима повезивања додатака са вашом продавницом! Жао нам је због непријатности. Додаци „Jetpack“ и „Woo