e it. No credit card numbers, no passwords, no worries.'=>'Изаберите плаћање које желите, платите одмах, платите касније или на рате. Без бројева кредитних картица, без лозинки и без бриге.','Accept debit and credit cards in 135+ currencies, methods such as Alipay, and one-touch checkout with Apple Pay.'=>'Прихватите дебитне и кредитне картице у више од 135 валута, методе као што су Alipay и плаћање једним додиром помоћу Apple Pay-а.','Store connected successfully.'=>'Продавница је успешно повезана.','Purchase & install now'=>'Купите и поставите одмах','Average order value'=>'Просечна вредност наруџбине','Gross sales'=>'Бруто продаје','Customer type'=>'Врста купца','Edit Coupon'=>'Уреди купон','Edit Product'=>'Уреди производ','Edit Order'=>'Уреди поруџбину','Bookings'=>'Резервације','Memberships'=>'Чланства','Home, furniture, and garden'=>'Дом, намештај и башта','Food and drink'=>'Храна и пиће','Electronics and computers'=>'Електроника и рачунари','Health and beauty'=>'Здравље и лепота','Fashion, apparel, and accessories'=>'Мода, одећа и додаци','Analytics'=>'Аналитика','[deleted]'=>'[обрисано]','Plugin status.'=>'Статус додатка.','Plugin name.'=>'Назив додатка.','Plugin slug.'=>'Подложак додатка.','IP address.'=>' IP адреса','Disable'=>'Онемогући','Profile Setup Wizard'=>'Чаробњак за подешавање профила','WooCommerce Onboarding'=>'Вукомерц укрцавање','Task List'=>'Листа задатака','Physical products'=>'Физички производи','CBD and other hemp-derived products'=>'ЦБД и други производи добијени из конопље','Download your %1$s Report: %2$s'=>'Преузмите свој %1$s Извештај: %2$s','There was an error connecting to Square.'=>'Десила се грешка приликом повезивања са Square-ом.','Download your %s Report'=>'Преузмите %s извештај','Current page retrieval should be called on or after the `current_screen` hook.'=>'Преузимање тренутне странице треба позвати на или након куке `current_screen`.','A partial IP address can be passed and matching results will be returned.'=>'Може се прос