MaxMind License Key'=>'MaxMind лиценцни кључ','An integration for utilizing MaxMind to do Geolocation lookups. Please note that this integration will only do country lookups.'=>'Интеграција за коришћење MaxMind-а за претраживање геолокација. Имајте на уму да ће ова интеграција вршити само претраживања по земљама.','Missing MaxMind Reader library!'=>'Недостаје библиотека MaxMind Reader-а!','Failed to download the MaxMind database.'=>'Преузимање базе података MaxMind-а није успело.','The MaxMind license key is invalid. If you have recently created this key, you may need to wait for it to become active.'=>'MaxMind лиценцни кључ је неважећи. Ако сте недавно креирали овај кључ, можда ћете морати да сачекате да се активира.','Learn more about how usage tracking works, and how you\'ll be helping in our <a href="%1$s" target="_blank">usage tracking documentation</a>.'=>'Сазнајте више о томе како функционише праћење употребе и како ћете помоћи у нашој <a href="%1$s" target="_blank">документацији о праћењу употребе</a>.','Please enter a value with one decimal point (%s) without thousand separators.'=>'Молим вас унесите вредност са једним децималним местом (%s) без раздвајања хиљада.','You must enter a valid license key on the <a href="%1$s">MaxMind integration settings page</a> in order to use the geolocation service. If you do not need geolocation for shipping or taxes, you should change the default customer location on the <a href="%2$s">general settings page</a>.'=>'Морате да унесете важећи лиценцни кључ на <a href="%1$s">страни за подешавање интеграције MaxMind</a> како бисте користили сервис геолокације. Ако вам геолокација није потребна за испоруку или порез, треба да промените подразумевану локацију купца на <a href="%2$s">страни за општа подешавања</a>.','Yes please'=>'Да, хвала','Welcome to'=>'Добродошли у','Get your store up and running more quickly with our new and improved setup experience'=>'Осигурајте да ваша продавница ради брже са нашим новим и побољшаним иску