ите купон код','Database information:'=>'Подаци о бази података:','Unable to retrieve database information. Usually, this is not a problem, and it only means that your install is using a class that replaces the WordPress database class (e.g., HyperDB) and WooCommerce is unable to get database information.'=>'Није могуће преузети информације из базе података. То обично није проблем, а то само значи да ваша инсталација користи класу која замењује класу базе података Вордпрес (нпр. HyperDB), а WooCommerce не може да добије информације из базе података.','Data: %1$.2fMB + Index: %2$.2fMB + Engine %3$s'=>'Data: %1$.2fMB + Index: %2$.2fMB + Engine %3$s','Unable to detect the REST API package.'=>'Откривање REST API пакета није могуће.','The WooCommerce REST API package running on your site.'=>'WooCommerce REST API је активан на вашој веб локацији.','WooCommerce REST API package'=>'WooCommerce REST API пакет','Postal code'=>'Поштански број','Additional content'=>'Додатни садржај','Text to appear below the main email content.'=>'Текст који ће се појавити испод главног садржаја електронске поште.','Town / Village'=>'Град / Село','Invalid field'=>'Неважеће поље','Tax class requires a valid name'=>'Порески разред захтева важећи назив','Or you can download a pre-built version of the plugin from the <a href="%1$s">WordPress.org repository</a> or by visiting <a href="%2$s">the releases page in the GitHub repository</a>.'=>'Или можете преузети унапред постојећу верзију додатка из <a href="%1$s">WordPress.org репозиторијума </a> или посетите <a href="%2$s">страницу издања у GitHub репозиторијуму </a>.','Tax class slug already exists'=>'Подложак пореске класе већ постоји','The Rest API is unavailable.'=>'REST API није доступан.','Order not editable'=>'Наруџба се не може изменити.','Learn how to upgrade'=>'Сазнајте како да пређете на ново издање','The sale will start at 00:00:00 of "From" date and end at 23:59:59 of "To" date.'=>'Продаја почиње у 00:00:00 од дана „Од“, а завршава се у