ensure they are compatible with the current version of WooCommerce. Suggestions to fix this:'=>'<strong>У вашој теми (%s) постоје застарели примерци неких шаблонских датотека WooCommerce-а.</strong> Ове датотеке можда треба ажурирати како би биле компатибилне са важећим издањем WooCommerce-а. Сугестије да се ово среди:','Which product category should be exported?'=>'Коју категорију производа треба извести?','Enter a number to set stock quantity at the variation level. Use a variation\'s \'Manage stock?\' check box above to enable/disable stock management at the variation level.'=>'Унесите број да подесите количину залиха на нивоу варијанте. Помоћу горњег поља \'Управљање залихама?\' за одређену варијанту укључите/искључите управљање залихама на нивоу варијанте.','Low stock amount'=>'Мале залихе','A live rate is the exact cost to ship an order, quoted directly from the shipping carrier.'=>'Цена уживо је тачна цена слања наруџбине која се добија директно од поштанског оператора.','If you\'d like to offer <span class="help_tip" data-tip="%1$s">live rates</span> from a specific carrier (e.g. UPS) you can find a variety of extensions available for WooCommerce <a href="%2$s" target="_blank">here</a>.'=>'Ако желите да понудите <span class="help_tip" data-tip="%1$s">цене уживо</span> одређеног оператора (нпр. UPS), <a href="%2$s" target="_blank">овде</a> можете наћи разна проширења која су доступна за WooCommerce.','This is the attachment ID, or image URL, used for placeholder images in the product catalog. Products with no image will use this.'=>'То је јединствени број прилога или URL слике која се користи за резервисање места за слику у каталогу производа. Користиће се за производе без слике.','Enter attachment ID or URL to an image'=>'Унесите ИД прилога или URL слике','We recommend using ShipStation to save time at the post office by printing your shipping labels at home. Try ShipStation free for 30 days.'=>'Препоручујемо ShipStation за уштеду у времену у пошти, тако што бисте етикете за слање пошиљке одштампали код куће. Испробајте бесплатно ShipStation током периода од 30 дана.','The "%s" payment method is currently disabled'=>'„%s“ начин плаћања тренутно није омогућен','The "%s" payment method is currently enabled'=>'„%s“ начин плаћања је тренутно омогућен','Set up the "%s" payment method'=>'Подеси „%s“ начин плаћања','Manage the "%s" payment method'=>'Управљај „%s“ начином плаћања','Move the "%s" payment method down'=>'Помери „%s“ начин плаћања надоле','Move the "%s" payment method up'=>'Помери „%s“ начин плаћања нагоре','We\'ve created two Shipping Zones - for %s and for the rest of the world. Below you can set Flat Rate shipping costs for these Zones or offer Free Shipping.'=>'Направили смо две зоне испоруке - за %s и за остатак света. Доле можете да подесите фиксни износ на име трошкова испоруке за ове зоне или да понудите бесплатну испоруку.','Sud Sardegna'=>'Јужна Сардинија','San Pedro'=>'Сан Педро','Cordillera'=>'Кордиљера','Are you sure you want to remove the selected items?'=>'Да ли сигурно желите да уклоните одабране артикле?','You may need to manually restore the item\'s stock.'=>'Можда ће бити потребно да ручно обновите залихе артикла.','Item moved up'=>'Артикал померен нагоре','Item moved down'=>'Артикал померен надоле','Kilograms'=>'Килограми','Grams'=>'Грами','Pounds'=>'Фунте','Ounces'=>'Унце','Meters'=>'Метри','Centimeters'=>'Центиметри','Millimeters'=>'Милиметри','Inches'=>'Инчи','Yards'=>'Јарде','Central'=>'Централни департман','Amambay'=>'Амамбај','Presidente Hayes'=>'Пресиденте Ајес','Alto Paraguay'=>'Алто Парагвај','Apartment, suite, unit, etc.'=>'Стан, апартман, локал итд.','%d API key permanently revoked.'=>'%d АПИ кључ је трајно повучен.' . "\0" . '%d АПИ кључа су трајно повучена.' . "\0" . '%d АПИ кључева је трајно повучено.','This action cannot be reversed. Are you sure you wish to erase personal data from the selected orders?'=>'Ова радња не може да се опозове. Да ли сигурно желите да обришете личне податке из одабраних наруџбина?','Cannot set attributes due to invalid parent product.'=>'Атрибути не могу да се поставе због неважећег матичног производа.','Payer PayPal address'=>'PayPal адреса платиоца','Payer last name'=>'Презиме платиоца','Payer first name'=>'Име платиоца','Shipping Address'=>'Адреса за испоруку','Billing Address'=>'Адреса фактурисања','Shipping Address 1'=>'Прва адреса за испоруку','Billing Address 1'=>'Прва адреса фактурисања','Your CSV needs to include columns in a specific order. %1$sClick here to download a sample%2$s.'=>'Колоне у CSV треба да буду поређане одређеним редоследом. %1$sКликните овде како бисте преузели узорни примерак%2$s.','shipping packagesShipping %d'=>'Достава %d','MySQL version string.'=>'Стринг са верзијом MySQL','privacy policy'=>'политика приватности','United States (US) dollar'=>'Амерички долар','If you have a coupon code, please apply it below.'=>'Ако имате купон са кодом, унесите код у поље испод.','This will be how your name will be displayed in the account section and in reviews'=>'Ово је како ће ваше име бити приказано у одељку налога и у рецензијама','eCheck ending in %1$s'=>'Електронска провера се завршава за %1$s','PayPal allows us to send one address. If you are using PayPal for shipping labels you may prefer to send the shipping address rather than billing. Turning this option off may prevent PayPal Seller protection from applying.'=>'PayPal нам омогућава да пошаљемо једну адресу. Ако користите PayPal за адреснице, можда ћете преферирати да пошаљете адресу за испоруку, а не наплату. Искључивање ове опције може спречити заштиту продавца PayPal-а.','terms and conditions'=>'услови кориштења','Required'=>'Обавезно','%s field'=>'%s поље','Other locations'=>'Друге локације','%1$s &ndash; %2$s'=>'%1$s &ndash; %2$s','%1$s (#%2$s)'=>'%1$s (#%2$s)','Account details:'=>'Подаци о рачуну:','These options let you change the appearance of the WooCommerce checkout.'=>'Ове опције омогућавају промену изгледа WooCommerce странице за потврду куповине. ','Please see the <a href="https://www.paypal.com/us/webapps/mpp/ua/privacy-full">PayPal Privacy Policy</a> for more details.'=>'За више информација погледајте <a href="https://www.paypal.com/us/webapps/mpp/ua/privacy-full">Политику приватности PayPal-а</a>.','We accept payments through PayPal. When processing payments, some of your data will be passed to PayPal, including information required to process or support the payment, such as the purchase total and billing information.'=>'Прихватамо плаћања преко PayPal-а. Приликом обраде трансакција неки ваши подаци достављају се PayPal-у, укључујући информације потребне за обраду или подршку плаћања, као што су укупни износ куповине и информације о обрачуну.','Any &quot;%1$s&quot; method'=>'Било који метод &quot;%1$s&quot; ','PayPal Standard redirects customers to PayPal to enter their payment information.'=>'PayPal стандард преусмерава купце на PayPal ради уноса информација за  плаћање.','No page set'=>'Ниједна страница није подешена','Highlight required fields with an asterisk'=>'Истакни обавезна поља звездицом','%s page'=>'Страна %s','Comma-separated list of search stopwords in your languageabout,an,are,as,at,be,by,com,for,from,how,in,is,it,of,on,or,that,the,this,to,was,what,when,where,who,will,with,www'=>'а,ако,али,би,биће,без,ће,ћу,чији,да,до,док,га,где,и,иако,их,или,има,испод,из,између,изнад,изван,ја,је,јер,јој,још,ју,к,ка,кад,када,како,као,кога,која,које,који,кроз,ли,ме,ми,мимо,му,на,над,након,нас,не,негде,него,нека,некад,неки,неко,нема,нешто,ни,није,ниједан,никад,ништа,о,од,одмах,око,около,он,она,онај,они,оно,осим,остали,ова,овај,ови,па,по,под,поред,после,поводом,пре,преко,према,при,с,са,сада,сам,само,се,си,шта,што,су,сутра,сваки,све,сви,та,тад,тада,тај,тако,такође,тамо,те,ти,тим,то,тој,ту,у,унутра,уз,већ,већина,веома,ви,више,врло,за,зар,зашто,зато,због','Optionally add some text for the terms checkbox that customers must accept.'=>'Опционо додајте неки текст за поље за потврду услова које купци морају да прихвате.','Log PayPal events, such as IPN requests, inside %s Note: this may log personal information. We recommend using this for debugging purposes only and deleting the logs when finished.'=>'Записуј PayPal догађаје, као што су IPN захтеви, у %s Напомена: овиме може да дође до записивања личних података. Препоручујемо да ово користите само у сврху отклањања грешака и да по завршетку обришете записе.','Take payments in person via checks. This offline gateway can also be useful to test purchases.'=>'Примате уплате лично путем чекова. Овакав офлајн посредник може да буде користан и за тестирање куповине.','Take payments in person via BACS. More commonly known as direct bank/wire transfer.'=>'Примајте плаћања лично преко BACS-а. Познато и као директан банковни/жичани пренос.','In this subsection you should list which third party payment processors you’re using to take payments on your store since these may handle customer data. We’ve included PayPal as an example, but you should remove this if you’re not using PayPal.'=>'У овом делу треба да наведете трећа лица која врше обрачун платног промета, а чије услуге користите за плаћање у вашој продавници, пошто та лица могу да рукују подацима о купцу. PayPal смо ставили за пример, а ви треба да уклоните PayPal ако га не користите.','In this section you should list who you’re sharing data with, and for what purpose. This could include, but may not be limited to, analytics, marketing, payment gateways, shipping providers, and third party embeds.'=>'У овом одељку треба да наведете са ким делите податке и у коју сврху. То може да обухвати, без ограничења, пружаоце услуга аналитике, маркетинга, шпедиције, посреднике у платном промету, као и угњеждене сервисе трећих страна.','We share information with third parties who help us provide our orders and store services to you; for example --'=>'Делимо информације са трећим лицима која нам помажу да вам пружимо услуге у вези са наруџбинама и продавницом; на пример --','Who on our team has access'=>'Ко у нашем тиму има приступ','We will also store comments or reviews, if you choose to leave them.'=>'Такође ћемо сачувати коментаре или рецензије, ако одлучите да их оставите.','What we share with others'=>'Шта делимо са другима','Our team members have access to this information to help fulfill orders, process refunds and support you.'=>'Чланови нашег тима имају приступ овим информацијама како би помогли у реализацији наруџбина, обради захтева за рефундацију и како би вам пружили подршку.','Order information like what was purchased, when it was purchased and where it should be sent, and'=>'Информације о наруџбини, као нпр. шта је купљено, када је купљено и где треба послати, и','Customer information like your name, email address, and billing and shipping information.'=>'Информације о купцу, као што су Ваше име, адреса е-поште, информације о фактурисању и испоруци.','We generally store information about you for as long as we need the information for the purposes for which we collect and use it, and we are not legally required to continue to keep it. For example, we will store order information for XXX years for tax and accounting purposes. This includes your name, email address and billing and shipping addresses.'=>'Ми генерално чувамо информације о вама докле год су нам оне потребне у сврху у коју их сакупљамо и користимо и докле год смо у обавези да их и даље чувамо. На пример, чуваћемо информације о наруџбини XXX година за пореске и рачуноводствене потребе. То укључује ваше име, адресу е-поште и адресе за обрачун и достављање.','Members of our team have access to the information you provide us. For example, both Administrators and Shop Managers can access:'=>'Чланови нашег тима имају приступ информацијама које нам доставите. На пример, и администратори и менаџери продавнице могу да приступе следећем:','Set up your account for our store'=>'Подесите ваш налог за нашу продавницу','If you create an account, we will store your name, address, email and phone number, which will be used to populate the checkout for future orders.'=>'Ако направите налог, похранићемо Ваше име, адресу, адресу е-поште и број телефона, што ће бити употребљено да се попуни образац потврде куповине при будућим наруџбинама.','Send you marketing messages, if you choose to receive them'=>'да Вам шаљемо маркетиншке поруке, ако изаберете да их примате','Improve our store offerings'=>'побољшамо понуду наше продавнице','Comply with any legal obligations we have, such as calculating taxes'=>'Поштовање свих законских обавеза које имамо, као што је обрачун пореза','Respond to your requests, including refunds and complaints'=>'одговарање на ваше захтеве, укључујући повраћај новца и жалбе','Send you information about your account and order'=>'Да вам пошаљемо податке о вашем налогу и наруџбини','Process payments and prevent fraud'=>'Обрада плаћања и спречавање преваре','When you purchase from us, we’ll ask you to provide information including your name, billing address, shipping address, email address, phone number, credit card/payment details and optional account information like username and password. We’ll use this information for purposes, such as, to:'=>'Када купујете од нас, тражићемо од вас податке, укључујући ваше име, адресу за наплату, адресу за испоруку, адресу е-поште, број телефона, податке о кредитној картици/плаћању и евентуално информације о налогу, као што су корисничко име и лозинка. Ове податке ћемо користити, на пример:','Note: you may want to further detail your cookie policy, and link to that section from here.'=>'Напомена: можда желите да детаљније уредите своју политику приватности и поставите везу одавде до тог одељка.','We’ll also use cookies to keep track of cart contents while you’re browsing our site.'=>'Такође ћемо користити колачиће да пратимо садржај корпе док Ви прегледате наш сајт.','Shipping address: we’ll ask you to enter this so we can, for instance, estimate shipping before you place an order, and send you the order!'=>'Адреса за испоруку: тражићемо да је унесете како бисмо, на пример, могли да проценимо испоруку пре него што наручите и пошаљемо вам наруџбину!','Location, IP address and browser type: we’ll use this for purposes like estimating taxes and shipping'=>'Локација, ИП адреса и врста претраживача: користићемо ове информације у сврху као што је процена износа пореза и испоруке','Products you’ve viewed: we’ll use this to, for example, show you products you’ve recently viewed'=>'Производи које сте погледали: користићемо ово да бисмо, на пример, приказали производе које сте скоро погледали','This sample language includes the basics around what personal data your store may be collecting, storing and sharing, as well as who may have access to that data. Depending on what settings are enabled and which additional plugins are used, the specific information shared by your store will vary. We recommend consulting with a lawyer when deciding what information to disclose on your privacy policy.'=>'Овај језички пример укључује основне информације о томе које личне податке ваша продавница може да прикупља, чува и дели, као и ко може да има приступ тим подацима. Зависно од тога која су подешавања омогућена и који други додаци се користе, разликоваће се и посебне информације које ваша продавница дели. Препоручујемо да се консултујете са правником када одлучујете које информације ћете обелодањивати у оквиру своје политике приватности.','While you visit our site, we’ll track:'=>'Док сте у посети нашој продавници, пратимо следеће:','We collect information about you during the checkout process on our store.'=>'Прикупљамо информације о вама у току поступка потврде куповине у нашој продавници.','What we collect and store'=>'Шта прикупљамо и чувамо','Download count'=>'Број преузимања','Order Number'=>'Број наруџбине','Token'=>'Токен','Access granted'=>'Приступ одобрен','Items Purchased'=>'Купљени артикли','User email'=>'е-пошта корисника','Payment Tokens'=>'Токени за плаћање','Browser User Agent'=>'Кориснички агент прегледача','Personal data removed.'=>'Лични подаци уклоњени.','Phone Number'=>'Број телефона','User roleCustomer'=>'Купац','optional'=>'опционо','%d permissions deleted'=>'%d дозвола обрисано','display name%1$s %2$s'=>'%1$s %2$s','Access to Purchased Downloads'=>'Приступ купљеним преузимањима','Customer Data'=>'Подаци о купцу','Billing State'=>'Држава Фактурисања','Billing City'=>'Град Фактурисања','Billing Company'=>'Фирма Фактурисања','Billing First Name'=>'Име Фактурисања','%1$s has been removed from your cart because it has since been modified. You can add it back to your cart <a href="%2$s">here</a>.'=>'Производ %1$s је уклоњен из корпе, зато што је у међувремену измењен. Можете га поново додати у корпу <a href="%2$s">овде</a>.','Error during status transition.'=>'Грешка приликом промене статуса.','Parent product does not match current variation.'=>'Матични производ не одговара предметној варијацији.','This tool will delete expired download permissions and permissions with 0 remaining downloads.'=>'Овај алат ће обрисати истекла овлашћења за преузимање и овлашћења са 0 преосталих преузимања.','Cloning is forbidden.'=>'Клонирање је забрањено.','Removed access to downloadable files.'=>'Уклоњен приступ датотекама које се преузимају.','Removed personal data from order %s.'=>'Уклоњени лични подаци из наруџбине %s.','Shipping City'=>'Град испоруке','Shipping Company'=>'Компанија испоруке','Shipping Last Name'=>'Презиме за испоруку','Update status event failed.'=>'Ажурирање статуса није успело.','Payment complete event failed.'=>'Плаћање није успело.','User roleShop manager'=>'Менаџер продавнице','Display name'=>'Име које се приказује','Display name cannot be changed to email address due to privacy concern.'=>'Име које се приказује не може да се промену у адресу е-поште због питања приватности.','Unserializing instances of this class is forbidden.'=>'Десеријализација инстанци ове класе је забрањена.','Deleted all active sessions, and %d saved carts.'=>'Све активне сеансе и %d снимљених корпи је обрисано.','This tool will delete all customer session data from the database, including current carts and saved carts in the database.'=>'Овај алат ће из базе података обрисати све податке о купчевим сеансама, укључујући тренутне корпе и корпе сачуване у бази података.','Clean up download permissions'=>'Почисти овлашћења за преузимање','Used-up download permissions'=>'Искоришћена овлашћења за преузимање','Limit result set to products with a specific attribute. Use the taxonomy name/attribute slug.'=>'Ограничите резултате на производе са одређеним атрибутом. Употребите подложак за назив таксономије/атрибут.','Order total formatted for locale'=>'Укупан износ наруџбине у локалном формату','Name of the customer for the order'=>'Име купца наруџбине','Customer download permissions have been retained.'=>'Задржане су купчеве дозволе за преузимање.','Blog id of the record on the multisite.'=>'Блог ИД записа на вишеструком сајту.','Personal data within order %s has been retained.'=>'Лични подаци у оквиру наруџбине %s су задржани.','Unable to create order.'=>'Није могуће креирати наруџбину.','Please read and accept the terms and conditions to proceed with your order.'=>'Молимо Вас да прочитате и прихватите услове како бисте наставили са пласирањем наруџбине.','URL to edit the order'=>'URL за уређивање наруџбине','Download ID'=>'ИД преузимања','Shipping Postal/Zip Code'=>'Поштански број испоруке','Billing Postal/Zip Code'=>'Поштански број фактурисања','Purchased Downloads'=>'Плаћена преузимања','Removed payment token "%d"'=>'Уклоњен токен за плаћање „%d“','Removed customer "%s"'=>'Уклоњен „%s“ купца','Your store does not appear to be using a secure connection. We highly recommend serving your entire website over an HTTPS connection to help keep customer data secure. <a href="%s">Learn more here.</a>'=>'Чини се да ваша продавница не користи сигурну везу. Препоручујемо да целокупну веб локацију доставите путем HTTPS везе како бисте заштитили податке купаца. <a href="%s">Сазнајте више овде.</a>','Shipping State'=>'Држава испоруке','Billing Last Name'=>'Презиме за фактуру','If the payment was refunded via the API.'=>'Ако је уплата враћена преко АПИ-ја.','Shipping First Name'=>'Име за испоруку','WooCommerce pages'=>'WooCommerce странице','WooCommerce database version'=>'Верзија WooCommerce базе података','Settings tab labelPayments'=>'Плаћања','Enable coupons'=>'Омогући купоне','%1$s - There is a newer version of WordPress available (%2$s)'=>'%1$s - Доступна је новија верзија Вордпреса (%2$s)','Rates will be configurable and taxes will be calculated during checkout.'=>'Стопе ће моћи да се подесе и порези ће се обрачунавати током фазе потврде куповине.','WordPress version'=>'Верзија Вордпреса','WordPress cron'=>'Крон за Вордпрес','Retain failed orders'=>'Сачувај неуспеле наруџбине','Failed orders are unpaid and may have been abandoned by the customer. They will be trashed after the specified duration.'=>'Неуспеле наруџбине нису плаћене и можда их је купац напустио. Биће послате у отпад после назначеног периода.','WordPress multisite'=>'WordPress multisite','WordPress debug mode'=>'Режим за отклањање грешке у Вордпресу','WordPress memory limit'=>'Ограничење меморије за Вордпрес','WooCommerce version'=>'Верзија WooCommerce','Displays whether or not WordPress is using an external object cache.'=>'Приказује да ли WordPress користи кеш екстерних објеката или не.','External object cache'=>'Кеш екстерних објеката','Enable tax rates and calculations'=>'Укључи пореске стопе и обрачун','Manage'=>'Уреди','Enable the legacy REST API'=>'Укључи наслеђен REST API','Account endpoints'=>'Крајње тачке налога','Secure checkout'=>'Безбедна потврда куповине','Legacy API'=>'Наслеђен API','Retain completed orders for a specified duration before anonymizing the personal data within them.'=>'Сачувај готове наруџбине током одређеног периода пре него што се лични подаци у њима анонимизују.','Retain completed orders'=>'Сачувај реализоване наруџбине','Pending orders are unpaid and may have been abandoned by the customer. They will be trashed after the specified duration.'=>'Наруџбине на чекању нису плаћене и купац може да их напусти. Биће послате на отпад после одређеног периода.','Retain cancelled orders'=>'Задржати отказане наруџбине','Cancelled orders are unpaid and may have been cancelled by the store owner or customer. They will be trashed after the specified duration.'=>'Отказане наруџбине су неуплаћене и могу бити отказане од стране власника продавнице или купца. Биће отпаднуте након наведеног временског периода.','Privacy policy'=>'Политика приватности','Remove personal data'=>'Уклони личне податке','Checkout privacy policy'=>'Политика приватности за потврду куповине','Guest checkout'=>'Потврда куповине за госте','Personal data retention'=>'Задржавање личних података','privacy page'=>'Страна о приватности','Optionally add some text about your store privacy policy to show on account registration forms.'=>'Опционо додајте неки текст о политици приватности за вашу продавницу који би се приказао на обрасцу за регистрацију налога.','Your personal data will be used to support your experience throughout this website, to manage access to your account, and for other purposes described in our %s.'=>'Ваши лични подаци биће употребљени тако да ваше искуство на овом веб-сајту буде угодније, за управљање приступом вашем налогу и у друге сврхе као што је описано у тексту %s.','Optionally add some text about your store privacy policy to show during checkout.'=>'Опционо додајте неки текст о политици приватности за вашу продавницу који би се приказао приликом потврде куповине.','Your personal data will be used to process your order, support your experience throughout this website, and for other purposes described in our %s.'=>'Ваши лични подаци биће употребљени за обраду ваше наруџбине, да ваше искуство на овом веб-сајту буде угодније, као и у друге сврхе као што је описано у тексту %s.','Retain inactive accounts '=>'Сачувај неактивне налоге','Retain pending orders '=>'Сачувај наруџбине на чекању','Accounts &amp; Privacy'=>'Налози и приватност','Account erasure requests'=>'Захтеви за брисање налога','Allow customers to create an account during checkout'=>'Омогући купцима да креирају налог током потврде куповине','Allow customers to log into an existing account during checkout'=>'Омогући купцима да се пријаве на постојећи налог приликом потврде куповине','Allow customers to place orders without an account'=>'Омогући купцима да пласирају наруџбину без налога','Filter by registered customer'=>'Филтрирај по регистрованим купцима','Use previous column mapping preferences?'=>'Узети параметре за мапирање из претходне колоне?','Registration privacy policy'=>'Политика приватности при регистрацији','Allowed emails'=>'Дозвољене адресе е-поште','Inactive accounts are those which have not logged in, or placed an order, for the specified duration. They will be deleted. Any orders will be converted into guest orders.'=>'Неактивни налози су они код којих није било пријава или наручивања током одређеног периода. Они се бришу. Све евентуалне наруџбине се претварају у наруџбине госта.','List of allowed billing emails to check against when an order is placed. Separate email addresses with commas. You can also use an asterisk (*) to match parts of an email. For example "*@gmail.com" would match all gmail addresses.'=>'Бела листа адреса е-поште за наплату која се проверава приликом пласирања наруџбине. Адресе раздвојити запетом. Такође може да се користи звездица (*) уместо дела адресе. Нпр. „*@gmail.com“ важи за све gmail адресе.','Allow customers to create an account on the "My account" page'=>'Омогући купцима да креирају налог на страни „Мој налог“','Choose how long to retain personal data when it\'s no longer needed for processing. Leave the following options blank to retain this data indefinitely.'=>'Одаберите колико дуго се чувају лични подац