il | 6.95 [+ 0.2%] | order</code>.'=>'По један у реду: Назив опције | Додатни трошкови [+- проценат] | По врсти трошка (наруџбина, класа или артикал). На пример: <code>Експресна пошиљка | 6,95 [+ 0,2%] | наруџбина</code>.','Optionally enable "Payment Data Transfer" (Profile > Profile and Settings > My Selling Tools > Website Preferences) and then copy your identity token here. This will allow payments to be verified without the need for PayPal IPN.'=>'Опционо омогућите "Трансфер података о плаћању" (Профил > Профил и Подешавања > Моји продајни алати > Параметри веб места) и ту копирајте свој идентификациони токен. Тиме ћете омогућити проверу плаћања без потребе за PayPal IPN.','Order #%1$s has been marked on-hold due to a reversal - PayPal reason code: %2$s'=>'Наруџбина #%1$s је означена као "на чекању" због враћања - PayPal код образложења: %2$s','Please send a check to Store Name, Store Street, Store Town, Store State / County, Store Postcode.'=>'Чек пошаљите на Име продавнице, Улица, Град, Земља, Поштански број.','Supports the following placeholders: <code>[qty]</code> = number of items, <code>[cost]</code> = cost of items, <code>[fee percent="10" min_fee="20"]</code> = Percentage based fee.'=>'Подржава следећа резервисана места: <code>[qty]</code> = број артикала, <code>[cost]</code> = цена артикала, <code>[fee percent="10" min_fee="20"]</code> = Накнада базирана на процентуалном износу.','Validation error: PayPal amounts do not match (amt %s).'=>'Грешка при провери: PayPal износи се не поклапају (amt %s).','Routing number'=>'Број за упућивање','Have your customers pay with cash (or by other means) upon delivery.'=>'Ваши купци плаћају у готовини (или другим средствима) приликом доставе.','If your main PayPal email differs from the PayPal email entered above, input your main receiver email for your PayPal account here. This is used to validate IPN requests.'=>'Уколико се ваша главна адреса е-поште разликује од горе уписане PayPal адресе е-поште, овде упишите своју главну адресу е-поште за свој PayPal налог. Она се користи за проверу ИПН захтева.','Welcome to {site_title}'=>'Добро дошли на {site_title}','Enable logging'=>'Укључи логовање','Excluding selected countries'=>'Искључи одабране државе','Minimum order amount'=>'Минимални износ наруџбине','Reversal cancelled for order #%s'=>'Поништење наруџбине #%s је отказано','Accept for virtual orders'=>'Прихвати виртуелне наруџбине','Make your payment directly into our bank account. Please use your Order ID as the payment reference. Your order will not be shipped until the funds have cleared in our account.'=>'Платите наруџбину директно на нашем рачуну. Молим вас користите број наруџбине као позив на број. Ваша наруџбина неће бити послата док средства не буду уплаћена на наш рачун.','New order'=>'Нова наруџбина','Note added to your {site_title} order from {order_date}'=>'Белешка додата у вези {site_title} наруџбине наручене {order_date}','Order complete emails are sent to customers when their orders are marked completed and usually indicate that their orders have been shipped.'=>'Е-пошта о готовим наруџбинама се шаље купцима када су њихове наруџбине означене као готове и углавном значи да им је наруџбина послата.','Cancelled order'=>'Отказана наруџбина','Failed order emails are sent to chosen recipient(s) when orders have been marked failed (if they were previously pending or on-hold).'=>'Е-пошта о неуспелој наруџбини шаље се одабраном примаоцу (или примаоцима) када су наруџбине обележене као неуспеле (уколико су претходно биле у фази обраде или на чекању).','What ZIP/post codes are available for local pickup?'=>'Који ПАК/поштански бројеви су доступни за локално преузимање?','Allowed ZIP/post codes'=>'Дозвољени ПАК/поштански бројеви','What ZIP/post codes are available for local delivery?'=>'Који ПАК/поштански бројеви су доступни за локалну доставу?','PayPal Standard does not support your store currency.'=>'PayPal Standard не подржава валуту ваше продавнице.','Customer "reset pass